import React from 'react';

interface SidebarProps {
    selectedProvince: string | null;
    selectedCity: string | null;
    provinceInfo: string | null;
    cityInfo: string | null;
}

const Sidebar: React.FC<SidebarProps> = ({ selectedProvince, selectedCity, provinceInfo, cityInfo }) => {
    return (
        <div className="sidebar">
            <h2>地理信息</h2>
            {selectedProvince && (
                <div>
                    <h3>{selectedProvince}</h3>
                    <p>{provinceInfo}</p>
                </div>
            )}
            {selectedCity && (
                <div>
                    <h3>{selectedCity}</h3>
                    <p>{cityInfo}</p>
                </div>
            )}
        </div>
    );
};

export default Sidebar;
